 a saying about hula: ‚ÄúI le‚Äòa ka hula i ka ho‚Äòopa‚Äòa‚Äù ‚Äì the hula is pleasing because of the drummer. 

It‚Äôs a well-known quote from Hula that means although the attention is given to the dancer, the drummer and chanter play an important role in the dance. 

One of the most commonly seen instruments used by hula performances is the ipu, or gourd. Kumu hula often use ipus, usually an ipu heke (double gourd), as a percussion instrument to create rhythm and sound for the chant and dancers. 

While hula dancers take great care of their instruments, usually keeping them in protective cloth cases, the instruments are made of natural materials and are subject to wear and tear. 

However, broken hula instruments are not discarded in the trash or treated carelessly. Being made of nature, they are returned to the natural environment. If an instrument is broken, the hula dancer returns it to the garden or burns it.

